import React from "react";
import "./style.css";
import {Container,Row,Col} from "react-bootstrap";

const Home = () => {
  return (
    <>
      <div id="webpage">
        <div id="webpage_body">
          <Container>
            <Row>
              <Col>1 of 2</Col>
              <Col>2 of 2</Col>
            </Row>
          </Container>
        </div>
      </div>
    </>
  );
};
export default Home;
